import React from "react";
import "bootstrap/dist/css/bootstrap.css";

function Login() {
  return (
    <>
      <div className="bg-dark p-2 text-white">
      <div class="d-flex flex-row">
        <div class="p-2">CIDC</div>
        <div class="p-2">Home</div>

        <div class="p-2"></div>
      </div>
      </div>
    </>
  );
}

export default Login;
